                        "command": "if (args[0].macroPass === \"preDamageRoll\" && rolledItem.type == 'weapon' && rolledItem.system.type.value.match(/^(simpleM|martialM)$/)) {\n\tif(rolledItem.system.properties.has(\"two\")) {\n\t\tlet parts = [];\n\t\trolledItem.system.damage.parts.forEach((part) => parts.push([replace(part[0]),part[1]]));\n\t\tworkflow.item = workflow.item.clone({'system.damage.parts': parts},{keepId: true});\n\t}\n\tif(rolledItem.system.properties.has(\"ver\")){\n\t\tworkflow.item = workflow.item.clone({'system.damage.versatile': replace(workflow.item.system.damage.versatile)},{keepId:true});\n\t}\n\n}\n\nfunction replace(part){\n\tvar i = 0; \n\tvar j = 0;\n\tvar modifiedPart = deepClone(part);\n\twhile(i>= 0){\n\t\tlet regex = /([0-9]d[0-9])/;\n\t\ti = search(modifiedPart, regex, i);\n\t\tregex = /([0-9]([^0-9d]|$))/;\n\t\ti = search(modifiedPart, regex, i);\n\t\tif (i>=0){\n\t\t\tmodifiedPart = modifiedPart.slice(0, i+1) + \"r<=2\" + modifiedPart.slice(i+1);\n\t\t\ti +=4;\n\t\t}\n\t\tj+=1;\n\t\tif (j>20) break; //max 20 modifications\n\t}\n\treturn modifiedPart;\n}\n\nfunction search(string, regexp, from) {\n    const index = string.slice(from).search(regexp);\n    return index === -1\n        ? -1\n        : index + from;\n}",
